package com.korartur.algorithms;

import com.koratur.algorithms.PermutationInString567;
import org.junit.Assert;
import org.junit.Test;

public class PermutationInString567Test {

    @Test
    public void Test1(){

        var p = new PermutationInString567();

        Assert.assertTrue(p.checkInclusion("ab", "eidbaooo"));

    }

    @Test
    public void Test2(){

        var p = new PermutationInString567();

        Assert.assertFalse(p.checkInclusion("ab", "eidboaoo"));

    }

    @Test
    public void Test3(){

        var p = new PermutationInString567();

        Assert.assertTrue(p.checkInclusion("adc", "dcda"));

    }

    @Test
    public void Test4(){

        var p = new PermutationInString567();

        Assert.assertTrue(p.checkInclusion(""
                , ""));

    }

    @Test
    public void Test5(){

        var p = new PermutationInString567();

        Assert.assertTrue(p.checkInclusion("abcd", "abcbad"));

    }

}
